import Link from "next/link";

const Navigations = () => {
  return (
    <ul>
      <li>
        <Link href="/">
          <a>Index</a>
        </Link>
      </li>
      <li>
        <Link href="/first-page">
          <a>First Page</a>
        </Link>
      </li>
    </ul>
  );
};

export default Navigations;
